import React, { Component } from 'react';

class App extends Component {
  state = {
    articles: [],
  }

  componentDidMount = ()=>{
    fetch('http://localhost:3012/')
    .then(res => {
      return res.json();
    })
    .then(article => {
      alert(article[2].title)
    })
    .catch((err) => {
      console.log(err);
    });
  }

  render() {
    return (
      <div className="App">
        <h1>hello</h1>
      </div>
    );
  }
}

export default App;
